module.exports = "/**@Author:2ue*@Date:2016-12-0616:35:25*@LastModifiedtime:2016-12-0616:35:29*//*在css样式文件中最好不要在开始设置@charset'utf-8',解析时要出问题;*//*don'tuse@charset'utf-8'atthebeginning,becauseitwilltriggersomeproblemswhenbrowserresolvesit*/html,body{width:100%;-webkit-tap-highlight-color:rgba(0,0,0,0);-webkit-overflow-scrolling:touch;overflow-scrolling:touch;}html,body,div,h1,h2,h3,h4,h5,h6,ul,ol,li,dl,dt,dd,img,fieldset,hr,legend,p,pre,table,thead,tbody,th,td,th,form,input,select,textarea,button{margin:0;padding:0;outline:none;}body{/*让页面里的字体变清晰,抗锯齿*//*makethefontlookliketosmoothly*/-webkit-font-smoothing:antialiased;-moz-osx-font-smoothing:grayscale;text-rendering:optimizeLegibility;font:12px/1.5MicrosoftYaHei,Arial,Helvetica,sans-serif;}/*继承父级元素属性*//*getattributesformparent*/a,h1,h2,h3,h4,h5,h6,input,select,button,option,textarea,optgroup{font-family:inherit;font-size:inherit;font-weight:inherit;font-style:inherit;line-height:inherit;color:inherit;outline:none;}a{text-decoration:none;cursor:pointer;}a:active,a:hover{outline:none;}a:focus{outline:none;-moz-outline:none;}table{border-spacing:0;border-collapse:collapse;}img{vertical-align:middle;-ms-interpolation-mode:bicubic;border:none;}ul,li,ol{list-style:none;}i,em,b,strong{font-weight:normal;font-style:normal;}input,select,textarea,button{/*使得表单元素在ie下能继承字体大小*//*makeelecangetattributesformparentonIE*/font-size:100%;border:none;background:none;appearance:none;-moz-appearance:none;-webkit-appearance:none;/*修正select盒模型不一致问题*//*fixedBoxmodelisn'tsame*/box-sizing:content-box;}input::-moz-focus-inner,button::-moz-focus-inner{/*解决outline火狐下失效问题*//*fixedoutlinenotworkinfirefox*/border:0;padding:0;}textarea{overflow-y:auto;resize:none;}a,input[type=button],input[type=submit],input[type=reset],button{cursor:pointer;}input::-webkit-input-placeholder,textarea::-webkit-input-placeholder{/*WebKitbrowsers*/color:#cbcbcb;}input:-moz-placeholder,textarea:-moz-placeholder{/*MozillaFirefox4to18*/opacity:1;color:#cbcbcb;}input:-ms-input-placeholder,textarea:-ms-input-placeholder{/*InternetExplorer10+*/color:#cbcbcb;}select::-ms-expand{/*IE兼容*//*fixedIE*/display:none;}"